(915, 1, '2015-09-25 16:49:37', '2015-09-25 15:49:37', 'Un grand nombre de familles et de personnes d\'origine étrangère et ou issue de\r\nl\'immigration connaissent mal les principes qui régissent notre société et le fonctionnement\r\ncomplexe de ses institutions et ramages.\r\nMaîtrisant mal la langue française, ils ont des difficultés de compréhension et de\r\ncommunication, et sont souvent désarmés devant les démarches administratives et dans les\r\nrapports aux institutions.\r\nCes personnes ont besoin de relais et de conseils dans leurs démarches en raison de la\r\nméconnaissance de leurs droits.\r\n\r\n<h3 style="color:orange;">Notre action :</h3>\r\n\r\n- Accueillir les personnes en difficultés, comprendre leur demande.\r\n- Les informer sur leurs droits, les aider dans les démarches à effectuer de manière\r\nà favoriser leur autonomie et leur intégration sociale.\r\n- Les orienter vers les organismes susceptibles de leur venir en aide, travailler en\r\nréseau.', 'Accompagnement social', '', 'inherit', 'open', 'open', '', '831-autosave-v1', '', '', '2015-09-25 16:49:37', '2015-09-25 15:49:37', '', 831, 'http://myriade.henry-morgan.pro/?p=915', 0, 'revision', '', 0),
