(917, 1, '2015-09-25 17:08:48', '2015-09-25 16:08:48', 'L’association Myriade gère un accueil de loisirs sur le quartier Cantarane, pour un maximum \r\nde 20 enfants.\r\nNous fonctionnons les mercredis et samedis (en période scolaire), aisni que pendant les \r\nvacances (fermé en août).\r\n\r\n<h3 style="color:orange;">Nos objectifs :</h3>\r\n\r\n-Réaliser des animations de proximité sur le quartier de Cantarane \r\n\r\n-Animer des ateliers artistiques avec des intervenants (peinture, dessin, créations diverses)\r\n\r\n-Proposer des sorties favorisant la mobilité douce (balades à pied, à vélo)\r\n\r\n-Entretenir des relations de partenariat avec des structures, associations locales\r\n\r\n-Permettre l\'accès aux loisirs pour les enfants fréquentant l\'association\r\n\r\n-Permettre aux enfants de sortir de leur quartier \r\n\r\n-Découvrir les ressources culturelles locales\r\n\r\n-Découvrir d\'autres cultures', 'Accueil de Loisirs sans Hébergement (ALSH)', '', 'publish', 'open', 'open', '', 'alsh', '', '', '2015-11-10 17:19:56', '2015-11-10 16:19:56', '', 0, 'http://myriade.henry-morgan.pro/?p=917', 0, 'post', '', 0),
